  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Moosehorn NWR
  outlines Refuge accomplishments from November, 1939 through January, 1940. The report
  begins by summarizing the weather conditions during this period. Wildlife- including
  big game animals, furbearers, and predators- is also covered. The Refuge development
  and maintenance section discusses physical developments. Resource management is
  outlined; topics include timber removal. The public relations section of the report
  describes law enforcement.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
